import ContentBox from '../components/contentBox'

const Plans = () => {
  return (
  <Fragment>
    <div className="w-100 h-100 h-pr-fl-ma centered b-s-b-b p-10px "><div className="w-100 h-100 h-pr-fl-ma"  Style="border: 1px solid; border-color: white;">
    <ContentBox title={"Planes"} subtitle={"Su nueva identidad de marca."} />
   </div></div>
    </Fragment>
  
 
  )
}

export default Plans
